# Oktyabrskoye, Khasavyurtovsky District, Republic of Dagestan

}}
Oktyabrskoye () is a rural locality (a selo) and the administrative centre of Oktyabrsky Selsoviet, Khasavyurtovsky District, Republic of Dagestan, Russia. Population:  There are 34 streets.
Geography
Oktyabrskoye is located 35&nbsp;km north of Khasavyurt (the district's administrative centre) by road. Dzerzhinskoye is the nearest rural locality.
